const letras = document.querySelector (".titulo");
console.log(letras);

function eligeReto(){
    buttonIn.setAttribute("hidden", true);
        const time = setInterval (function(){
        console.log("Girar");
        const aleatorio = Math.floor(Math.random() * retos.length);
        srcImg.src = retos [aleatorio].imagen;
        letras.innerText = retos [aleatorio].nombre;

    }, 400);
    setTimeout(function(){
        clearInterval(time)
        buttonIn.removeAttribute("hidden");
        buttonIn.innerText = "De nuez";
        alert("perdiste");
    }, 4000);
   
}
 buttonIn.addEventListener("click", eligeReto);




